import React from 'react'
import "/Circle.css"

const Circle = () => {
  return (
    <div class="progress">
    <span class="title timer" data-from="0" data-to="85" data-speed="1800">85</span>
    <div class="overlay"></div>
    <div class="left"></div>
    <div class="right"></div>
    </div>
  )
}

export default Circle
